import { Injectable } from '@angular/core';


@Injectable({
  providedIn: 'root'
})
export class SharedDataService {
  private token: string | null = null;
  private projectDeatils : object;
  setToken(token: string) {
    console.log(this.token);
    this.token = token;
  }

  getToken(): string | null {
    console.log(this.token);
    return this.token;
  }

  setProjectDeatils(details : any){
    this.projectDeatils = details;
  }

  getProjectDeatils(){
   return this.projectDeatils;
  }
}
